import React,{useEffect,useState} from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import UserLayout from '../../layouts/user.layout';

const UserDashboard = () =>  {
	const [products,setProducts] = useState([]);
	useEffect (()=>{
		const token = localStorage.getItem('token');
		const header = {Authorization:`Bearer ${token}`};
		axios.get(`${process.env.REACT_APP_USER_BASE_URL}/get-products`,{headers:header})
		.then((response)=>{
			setProducts(response.data.products);
		}).catch((err)=>{
			console.log(err);
		});
	},[]);
	return (
		<UserLayout>
			<div>
				<div className='container'>
					<h2 className='text-center'>Products</h2>
					<div className='row'>
						<div className='col-md-10'></div>
						<div className='col-md-2'>
							<Link to='/cart'>My cart</Link>
						</div>
					</div>
					{/* <div className='row'>
						<div className='col-md-3'>Name</div>
						<div className='col-md-3'>Price</div>
						<div className='col-md-3'>Quantity Left</div>
						<div className='col-md-3'>Add to cart</div>
					</div> */}
					{products && products.length>0? 
						<div className='row mt-2'>
						products?.map(item=>
							<div className='col-md-4'>{item?.name}</div>
							<div className='col-md-3'>Price {item?.price}</div>
							<div className='col-md-3'>Quantity Left {item?.quantity}</div>
							<div className='col-md-3'>Add to cart</div>
						)
						</div>
					:''
					}
				</div>
			</div>
	  </UserLayout>
	);
}

export default UserDashboard;
